import react, {useState} from 'react';
import { scryRenderedComponentsWithType } from 'react-dom/test-utils';


function UserForm (props) {

    const [state, setState] = useState({
        username: '',
        email: '',
        country: '',
        password: '',
    });

    return (
        <div>
            <form>
                <div>
                    <label>Username</label>
                    <input type='text' name='username' value={state.username}></input>
                </div>

                <div>
                    <label>Email</label>
                    <input type='text' name='email' value={state.email}></input>
                </div>

                <div>
                    <label>Country</label>
                    <input type='text' name='country' value={state.country}></input>
                </div>

                <div>
                    <label>Password</label>
                    <input type='password' name='password' value={state.password}></input>
                </div>

                <div>
                    <button>Submit</button>
                </div>
            </form>
        </div>
    )
};

export default UserForm;
